use std::io::{BufReader, Cursor};

use ark_circom::{circom::R1CSFile, CircomBuilder, CircomConfig, WitnessCalculator};
use ark_ff::PrimeField;
use wasmer::{Module, Store};

pub const CIRCUIT_R1CS: &[u8] = include_bytes!("static/circuit.r1cs");
pub const CIRCUIT_WASM: &[u8] = include_bytes!("static/circuit.wasm");

pub fn get_circom_builder<F: PrimeField>() -> CircomBuilder<F> {
    let mut store = Store::default();
    let reader = BufReader::new(Cursor::new(&CIRCUIT_R1CS));

    let r1cs = R1CSFile::<F>::new(reader).unwrap();

    let mut module = Module::new(&store, &CIRCUIT_WASM).unwrap();
    module.set_name("sui_zkrp");
    let wtns = WitnessCalculator::from_module(&mut store, module).unwrap();

    let cfg = CircomConfig {
        wtns,
        r1cs: r1cs.into(),
        store,
        sanity_check: false,
    };

    CircomBuilder::new(cfg)
}

